import './App.css';
import 'tachyons';

class App extends Component {
  render() {
    return (
      <div className="f1 ma3 ba br3 shadow-5 tc bg-light-green b--white dark-blue pa3">
        Welcome to the Blogger <br/>
        <span className="blue">Hie there </span>

      </div>
    );
  }
}

export default App;
